  render(){
    const box = {
      width:400
    }
    const leftalign = {
      "text-align":"left"
    }
    const rightalign = {
      "text-align":"right"
    }
    return(
      <div style ={box}>
      <div style={{float:"left"}}>
      <h1 style={leftalign}>Job title</h1>
      <h2 style={leftalign}>Company</h2>
      <h2 style={leftalign}>City</h2>
      </div>
      <div style={{float:"right"}}>
      <h2 style={rightalign}>2015-Present</h2>
      <h3 style={rightalign}>38 hrs per week</h3>
      <h3 style={rightalign}>$90k per year</h3>
      </div>
      </div>
      //<h2>{this.props.company_name}</h2>
    )
  }
}

export default Job;
